import React from 'react'
import Card from '../components/TeamCards/Card.jsx';
import { Grid } from '@material-ui/core';

const Team = () => {
    return (
        <>
            <Grid container>
                <Grid item xs={12} sm={6} >
                    <Card />
                </Grid>
            </Grid>
        </>
    )
}

export default Team
